import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    {
      id: 1,
      title: "Car Insurence",
      amount: 294.67,
      date: new Date(2021, 5, 12),
    },
    {
      id: 2,
      title: "Car Insurence",
      amount: 294.67,
      date: new Date(2021, 5, 12),
    },
    {
      id: 3,
      title: "Car Insurence",
      amount: 294.67,
      date: new Date(2021, 5, 12),
    },
    {
      id: 4,
      title: "Car Insurence",
      amount: 294.67,
      date: new Date(2021, 5, 12),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      {expenses.map((expense) => (
        <ExpenseItem

          title={expenses.title}
          amount={expenses.amount}
          date={expenses.date}
        />
      ))}
    </div>
  );
}

export default App;
